def is_3_multiple(num):
    return num % 3 == 0

def is_5_multiple(num):
    return num % 5 == 0

def fizbuzz(n):
    req_list = []
    for num in range(1,n+1):
        if not (is_3_multiple(num) or is_5_multiple(num)):
            req_list.append(num)
        else:
            if is_5_multiple(num) and is_3_multiple(num):
                req_list.append('FizzBuzz')
            elif is_3_multiple(num):
                req_list.append('Fizz')
            elif is_5_multiple(num):
                req_list.append('Buzz')


    return req_list

