def getCostOfCoffee(numberOfCoffees,pricePerCoffee):
    if numberOfCoffees > 8 :
        no_of_free_coffees= numberOfCoffees//8
        no_of_paid_coffees= (numberOfCoffees)-(no_of_free_coffees)
    else :
        no_of_paid_coffees= numberOfCoffees
    total_cost=(no_of_paid_coffees)*(pricePerCoffee)
    return float(total_cost)

